import React from "react";
import { useTranslation } from "react-i18next";
import { CustomToolbar } from "Components/";

function LandingPage() {
  const { i18n } = useTranslation();
  return (
    <CustomToolbar
      title={i18n.t("title")}
      options={[
        i18n.t("nav.about"),
        i18n.t("nav.services"),
        i18n.t("nav.projects"),
        i18n.t("nav.careers"),
        i18n.t("nav.contact")
      ]}
    />
  );
}

export default LandingPage;
